import React from 'react';
import { Link } from 'react-router-dom';

function CustomButton({ variant }) {
  let buttonText = '';

  switch (variant) {
    case 'login':
      buttonText = 'Connexion';
      break;
    case 'register':
      buttonText = 'S\'enregistrer';
      break;
    default:
      buttonText = 'Bouton';
  }

  return (
    <Link to="/accueil"> {/* Utiliser Link pour la navigation */}
      <button>{buttonText}</button>
    </Link>
  );
}

export default CustomButton;
